import React from 'react';

const VideoItem = ({ video, onUpVote, onDownVote}) => {
  return (
    <div className="video-item">
      <h3>{video.title}</h3>
      <iframe
        src={video.url}
        title={video.title}
        width="560"
        height="315"
        frameBorder="0"
        allowFullScreen
      ></iframe>
      <p>Votes: {video.votes}</p>
      <button onClick={() => onUpVote(video)}>
        <i className="fas fa-thumbs-up"></i> Up Vote
      </button>
      <button onClick={() => onDownVote(video)}>
        <i className="fas fa-thumbs-down"></i> Down Vote
      </button>
      <button onClick={() => onDelete(video)}>Delete</button>
    </div>
  );
};

export default VideoItem;
